import com.smartshop.dto.OrderItemDTO;
import com.smartshop.model.Commande;
import com.smartshop.model.OrderItem;
import com.smartshop.model.Product;

public class OrderItemMapper {

    // DTO → ENTITY
    public static OrderItem toEntity(OrderItemDTO dto) {
        if (dto == null) return null;

        return OrderItem.builder()
                .id(dto.getId())
                .quantity(dto.getQuantity())
                .prixUnitaireLigne(dto.getPrixUnitaireLigne())
                .totalLigne(dto.getTotalLigne())

                // نربطو IDs فقط (Lazy objects)
                .commande(Commande.builder().id(dto.getCommandeId()).build())
                .product(Product.builder().id(dto.getProductId()).build())

                .build();
    }

    // ENTITY → DTO
    public static OrderItemDTO toDTO(OrderItem entity) {
        if (entity == null) return null;

        return OrderItemDTO.builder()
                .id(entity.getId())
                .quantity(entity.getQuantity())
                .prixUnitaireLigne(entity.getPrixUnitaireLigne())
                .totalLigne(entity.getTotalLigne())

                // IDs extraction
                .commandeId(entity.getCommande() != null ? entity.getCommande().getId() : null)
                .productId(entity.getProduct() != null ? entity.getProduct().getId() : null)

                .build();
    }

public static PaiementDTO toDto(Paiement paiement){
       if(paiement == null ) return null;
       return PaiementDTO.builder()
               .id(paiement.getId())
               .banque(paiement.getBanque())
               .numeroPaiement(paiement.getNumeroPaiement())
               .commandeId(paiement.getCommande() != null ? paiement.getCommande().getId():null)
               .datePaiement(paiement.getDatePaiement())
               .dateEcheance(paiement.getDateEcheance())
               .dateEncaissement(paiement.getDateEncaissement())
               .montant(paiement.getMontant())
               .typePaiement(paiement.getTypePaiement())
               .reference(paiement.getReference())
               .status(paiement.getStatus())
               .build();
   }
